// Nome da variável a ser verificada
const ultimaInteracao = $input.first().json['ultima_interação-WPP'];

// 30 minutos em milissegundos
const THIRTY_MINUTES = 30 * 60 * 1000;

// Se estiver vazia, nula ou indefinida → true
if (!ultimaInteracao) {
  return [
    {
      json: {
        result: true
      }
    }
  ];
}

// Converte para data
const ultimaInteracaoTime = new Date(ultimaInteracao).getTime();

// Se data inválida → true (segurança)
if (isNaN(ultimaInteracaoTime)) {
  return [
    {
      json: {
        result: true
      }
    }
  ];
}

// Calcula diferença de tempo
const diff = Date.now() - ultimaInteracaoTime;

// Retorna true se passou de 30 minutos
return [
  {
    json: {
      result: diff > THIRTY_MINUTES
    }
  }
];

